import { SDetail, SSection } from "../style";

type Props = {

};

const url = browserHistory.getCurrentLocation().pathname;
alert(url)
const BlogList: NextPage<Props, any> = () => {
  return (
    <>
      <main>Your:</main>
      <SSection>
        <SDetail>
          <div>welcome to my page !</div>
          <p>Look my daily</p>
          <Link href="/post/blog/dairy">
